import { Student } from "./student.model";
const students=
    [{id:1,name:"fghj",phon:"13456",family:"jk",addres:"hjk 5",avg:89,works:false,dateLeave:new Date(),tests:[{code:1,date:new Date(),description:"jkk"},{code:2,date:new Date(),description:"yy"}]},{id:2,name:"fgk",phon:"1345678956",family:"hjkjk",addres:"hjk 9",avg:100,works:true}];
    
@Injectable()
export class studentService{
     getStudents(): Promise<Student[]>{
        return new Promise((res ,rej)=>{
         res(students);
      });
     }
     getStudentsAfterSeconds(): Promise<Student[]>{
      return new Promise((res ,rej)=>{
       res(students);
    });
   }
}
